        private void btnLaske_Click(object sender, System.EventArgs e)
        {
            double summa = 0;
            double keskiarvo = 0;
            double maksu;

            // Luetaan maksut
            if (double.TryParse(txtMaksu1.Text, out maksu))
            {
                summa += maksu;
            }
            if (double.TryParse(txtMaksu2.Text, out maksu))
            {
                summa += maksu;
            }
            if (double.TryParse(txtMaksu3.Text, out maksu))
            {
                summa += maksu;
            }
            if (double.TryParse(txtMaksu4.Text, out maksu))
            {
                summa += maksu;
            }
            if (double.TryParse(txtMaksu5.Text, out maksu))
            {
                summa += maksu;
            }

            // Lasketaan keskiarvo
            if (summa > 0)
            {
