#include <stdio.h>

int main(void)
{
    int n, i, j;

    printf(""Enter size of magic square: "");
    scanf(""%d"", &n);

    int magic_square[n][n];

    // set all slots as 0
    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
            magic_square[i][j] = 0;
    }

    // Initialize position for 1
    i = n / 2;
    j = n - 1;

    // One by one put all values in magic square
    for (int num = 1; num <= n * n;)
    {
        if (i == -1 && j == n) // 3rd condition
        {
            j = n - 2;
            i = 0;
        }
        else
        {
            // 1st condition helper if next number
            // goes to out of square's right side
            if (j == n)
                j = 0;

            // 1st condition helper if next number
            // is goes to out of square's upper side
            if (i < 0)
                i = n - 1;
        }
        if (magic_square[i][j]) // 2nd condition
        {
            j -= 2;
            i++;
            continue;
        }
        else
            magic_square[i][j] = num++; // set number

        j++;
        i--; // 1st condition
    }

    // Print magic square
    printf(""The Magic Square for n=%d:
Sum of each row or column %d:

"",
           n, n * (n * n + 1) / 2);
    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
            printf(""%3d "", magic_square[i][j]);
        printf(""
"");
    }

    return 0;
}

#include <stdio.h>

int main(void) 
{
	int n;
	scanf(""%d"",&n);
	int a[n],i,j,temp;
	for(i=0;i<n;i++)
	{
		scanf(""%d "",&a[i]);
	}
	for(i=0;i<n;i++)
	{
		for(j=i+1;j<n;j++)
		{
			if(a[i]>a[j])
			{
				temp=a[i];
				a[i]=a[j];
				a[j]=temp;
			}
		}
	}
	for(i=0;i<n;i++)
	{
		printf(""%d "",a[i]);
	}
	return 0;
}

